package org.example.leetcode.interview150.medium.arrayandstring;

import java.util.Arrays;

//238. Product of Array Except Self
//Medium
//Topics
//Companies
//Hint
//Given an integer array nums, return an array answer such that answer[i] is equal to the product of all the elements of nums except nums[i].
//
//The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.
//
//You must write an algorithm that runs in O(n) time and without using the division operation.
//
//
//
//Example 1:
//
//Input: nums = [1,2,3,4]
//Output: [24,12,8,6]
//Example 2:
//
//Input: nums = [-1,1,0,-3,3]
//Output: [0,0,9,0,0]
//
//
//Constraints:
//
//2 <= nums.length <= 105
//-30 <= nums[i] <= 30
//The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.
//
//
//Follow up: Can you solve the problem in O(1) extra space complexity?
// (The output array does not count as extra space for space complexity analysis.)
public class _13_ProductOfArrayExceptSelf {
    public static void main(String[] args) {
        int[] nums1 = {1, 2, 3, 4};
        int[] output1 = {24,12,8,6};
        int[] nums2 = {-1, 1, 0, -3, 3};
        int[] output2 = {0,0,9,0,0};

        int[] result1 = productExceptSelf(nums1);
        int[] result2 = productExceptSelf(nums2);

        if(Arrays.equals(result1,output1) && Arrays.equals(result2,output2))
            System.out.println("All test are passed");
        else System.out.println("There are failures");

        System.out.println("Output for nums1: " + Arrays.toString(result1));
        System.out.println("Output for nums2: " + Arrays.toString(result2));
    }

    public static int[] productExceptSelf(int[] nums) {
        int n = nums.length;
        int[] ans = new int[n];

        // Calculate left products
        int leftProduct = 1;
        for (int i = 0; i < n; i++) {
            ans[i] = leftProduct;
            leftProduct *= nums[i];
        }

        // Calculate right products and multiply with left products
        int rightProduct = 1;
        for (int i = n - 1; i >= 0; i--) {
            ans[i] *= rightProduct;
            rightProduct *= nums[i];
        }

        return ans;
    }

    public int[] productExceptSelf2(int[] nums) {

        int n=nums.length;
        int[] res = new int[n];

        res[n-1] = nums[n-1];
        for(int i=n-2;i>0;i--)
            res[i]=res[i+1]*nums[i];

        int left=1;
        for(int i=0;i<n-1;i++) {
            res[i]=left*res[i+1];
            left*=nums[i];
        }
        res[n-1]=left;

        System.gc();
        return res;
    }

    public int[] productExceptSelf3(int[] nums) {
        int n = nums.length;
        int[] leftProducts = new int[n];
        int[] rightProducts = new int[n];
        int[] ans = new int[n];

        // Calculate left products
        leftProducts[0] = 1;
        for (int i = 1; i < n; i++) {
            leftProducts[i] = leftProducts[i - 1] * nums[i - 1];
        }

        // Calculate right products
        rightProducts[n - 1] = 1;
        for (int i = n - 2; i >= 0; i--) {
            rightProducts[i] = rightProducts[i + 1] * nums[i + 1];
        }

        // Combine left and right products
        for (int i = 0; i < n; i++) {
            ans[i] = leftProducts[i] * rightProducts[i];
        }

        return ans;
    }


    public int[] productExceptSelf4(int[] nums) {
        int n = nums.length;
        int[] leftProducts = new int[n];
        int[] rightProducts = new int[n];
        int[] ans = new int[n];

        // Calculate the product of elements to the left of each element
        int leftProduct = 1;
        for (int i = 0; i < n; i++) {
            leftProducts[i] = leftProduct;
            leftProduct *= nums[i];
        }

        // Calculate the product of elements to the right of each element
        int rightProduct = 1;
        for (int i = n - 1; i >= 0; i--) {
            rightProducts[i] = rightProduct;
            rightProduct *= nums[i];
        }

        // Multiply corresponding left and right products to get the result
        for (int i = 0; i < n; i++) {
            ans[i] = leftProducts[i] * rightProducts[i];
        }

        return ans;
    }


    // TimeLimitExceed // will not work as o(n2) is the TC and asked to perform in o(n).
    public int[] productExceptSelf_(int[] nums) {
        int n = nums.length;
        int[] ans = new int[n];
        int sum = 1;
        for(int i = 0; i<n; i++){
            for(int j=0; j<n;j++){
                if(i!=j){
                    sum*= nums[j];
                }
            }
            ans[i] = sum;
            sum = 1;
        }
        return ans;
    }
}

